import { GridItemType } from '../../types/GridItemType';
import * as C from './styles';

type Props = {
    item: GridItemType,
    onClick: () => void
}

export const GridItem = ({item, onClick}: Props) => {
    return (
        <C.Container onClick={onClick}>
           {!item.permanentShown && !item.shown}
        </C.Container>
    );
}
